import React, { Component } from "react";
import "../Cssfile/Dashboard.css";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import IconButton from "@material-ui/core/IconButton";
import Typography from "@material-ui/core/Typography";
import InputBase from "@material-ui/core/InputBase";
import Badge from "@material-ui/core/Badge";
import { withStyles } from "@material-ui/styles";
import MenuItem from "@material-ui/core/MenuItem";
import Menu from "@material-ui/core/Menu";
import { fade } from "@material-ui/core/styles/colorManipulator";
import  keeplogo from "../image/keeplogo.png";
import  setting from "../image/setting.svg";
import  keep1 from "../image/1.svg";
import   keep2 from "../image/2.svg";
import {
  createStyles,
  Theme

} from "@material-ui/core/styles";
import MenuIcon from "@material-ui/icons/Menu";
import SearchIcon from "@material-ui/icons/Search";
import AccountCircle from "@material-ui/icons/AccountCircle";
import MailIcon from "@material-ui/icons/Mail";
import NotificationsIcon from "@material-ui/icons/Notifications";
import MoreIcon from "@material-ui/icons/MoreVert";
import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';
// const OverridedInputBase = withStyles({
//   input: {
//     width: "670px",
//     minWidth: "80px",
//     marginTop:"1%"    
//   }
// })(InputBase);

const theme = createMuiTheme({
  overrides: {
    MuiPaper:{
    elevation4:{
        boxShadow: '0px 3px 0px -3px rgba(0,0,0,0.2), 0px 4px 5px 0px rgba(0,0,0,0.14), 0px 1px 10px 0px rgba(0,0,0,0.12)'
      }
     },


  },
});

class Dashboard extends Component {
  constructor(props) {
    super(props);

    this.state = {
      anchorEl: null
    };
  }

  render() {
    let isMenuOpen = Boolean("anchorEl");
    return (
      <div className="mainDashboard">
        <MuiThemeProvider theme={theme}>
        <AppBar position="fixed"  >
          <Toolbar className="toolbar" style={{backgroundColor:'white'}}>
            <div className="keepAndLogo">
              <IconButton color="inherit" aria-label="Open drawer">
                <MenuIcon />
              </IconButton>
              <img src={keeplogo} width="30%" height="30%" alt="hello"></img>
              <Typography className="keep" variant="h6" color="inherit" noWrap>
                 <b  style={{marginLeft :'2%'}}>Keep</b>

              </Typography>
            </div>

            <div className="dashboardSearch">
              <div className="dashboardsearchicon" >
                <IconButton  style={{justifyContent:'start ',display:'flex'}} >
                  <SearchIcon  />
                </IconButton>
              </div>
              <div  class>
                <InputBase color="white" placeholder="Search…"   style={{marginTop:'3%',paddingRight:'49%'}}/>
              </div>
            </div>

            <div className="logokeep1">
            <img src={keep2} width="30" height="30%" alt="hello"></img>
            <img src={keep1} width="30%" height="30%" alt="hello"></img>
            <img src={setting} width="30%" height="30%" alt="hello"></img> 

            </div>
            <div>
              <IconButton
                aria-owns={isMenuOpen ? "material-appbar" : undefined}
                aria-haspopup="true"
                onClick={this.handleProfileMenuOpen}
                color="inherit"
              >
                <AccountCircle />
              </IconButton>
            </div>
          </Toolbar>
        </AppBar>
        </MuiThemeProvider>
      </div>
    );
  }
}

export default Dashboard;
